caption.text:
@tombrady (Tom Brady) has reached ultimate “unc” status (according to his son Benny) 😏

The football icon and Benny chat about how social media has changed the game for football recruiting (goodbye VHS tapes 👋) — plus who Benny would DM if he had access to his dad’s Instagram for a day 😎

It all goes down in the second episode of Carversations, our series where parents have conversations with their teens about how they’re using social media 🚗 Watch the full episode on our YouTube channel (link in bio).
